/** Uses the NodeAccessInfo of pOther and its children. */
void ManagementInterfaceTypeBase::useAccessInfoFromInstance(ManagementInterfaceTypeBase *pOther)
{
    OpcUa::BaseObjectType::useAccessInfoFromInstance(pOther);

    // children
    m_pHttpActive->useAccessInfoFromInstance(pOther->m_pHttpActive);
    m_pHttpsActive->useAccessInfoFromInstance(pOther->m_pHttpsActive);
    m_pHttpsTcpPort->useAccessInfoFromInstance(pOther->m_pHttpsTcpPort);
    m_pHttpTcpPort->useAccessInfoFromInstance(pOther->m_pHttpTcpPort);
    m_pNumberOfHttpAndHttpsLoginSessions->useAccessInfoFromInstance(pOther->m_pNumberOfHttpAndHttpsLoginSessions);
    m_pNumberOfTelnetAndSshLoginSessions->useAccessInfoFromInstance(pOther->m_pNumberOfTelnetAndSshLoginSessions);
    m_pSnmpActive->useAccessInfoFromInstance(pOther->m_pSnmpActive);
    m_pSnmpPort->useAccessInfoFromInstance(pOther->m_pSnmpPort);
    m_pSnmpTransportProtocol->useAccessInfoFromInstance(pOther->m_pSnmpTransportProtocol);
    m_pSshActive->useAccessInfoFromInstance(pOther->m_pSshActive);
    m_pSshTcpPort->useAccessInfoFromInstance(pOther->m_pSshTcpPort);
    m_pTelnetActive->useAccessInfoFromInstance(pOther->m_pTelnetActive);
    m_pTelnetTcpPort->useAccessInfoFromInstance(pOther->m_pTelnetTcpPort);
    m_pSetManagementInterfaceMethod->useAccessInfoFrom(pOther->m_pSetManagementInterfaceMethod);
}

